\pard\sa200\sl276\slmult1\qc\ulnone The below are the key differences between a Numeric and a string Data Type:\par

\pard 
{\pntext\f0 1.\tab}{\*\pn\pnlvlbody\pnf0\pnindent0\pnstart1\pndec{\pntxta.}}
\fi-360\li720\sa200\sl276\slmult1\ul\b Representation\ulnone :   \ul\par

\pard{\pntext\f2\'B7\tab}{\*\pn\pnlvlblt\pnf2\pnindent0{\pntxtb\'B7}}\fi-360\li1800\sa200\sl276\slmult1\ulnone Numeric Data Type: \b0 Numeric data types represent numerical values, such as integers or floating-point numbers. Examples include integers like 1, 100, or -5, and floating-point numbers like 3.14 or -0.001\b .\ul\par
{\pntext\f2\'B7\tab}\ulnone String Data Type: \b0 String data types represent sequences of characters. They are used to store textual data and are enclosed in single (' '), double (" "), or triple (''' ''' or """ """) quotes. Examples include "Hello, World!", '123', or "3.14".\ul\b\par

\pard\sa200\sl276\slmult1\ulnone        2.\tab\ul Operations:   \par

\pard{\pntext\f2\'B7\tab}{\*\pn\pnlvlblt\pnf2\pnindent0{\pntxtb\'B7}}\fi-360\li1800\sa200\sl276\slmult1\ulnone Numeric Data Type\b0 : Numeric types support mathematical operations, such as addition, subtraction, multiplication, and division. These operations are performed based on the numeric values they represent.\par
{\pntext\f2\'B7\tab}\b String Data Type\b0 : String types, on the other hand, are mainly used for text manipulation. While some languages allow concatenation (joining) of strings using the + operator, the operations are generally different from mathematical operations.\par

\pard\sa200\sl276\slmult1\b      3.\tab\ul Type Conversion:\par

\pard{\pntext\f2\'B7\tab}{\*\pn\pnlvlblt\pnf2\pnindent0{\pntxtb\'B7}}\fi-360\li1800\sa200\sl276\slmult1\ulnone Numeric Data Type: \b0 Numeric types can often be converted to other numeric types, such as converting an integer to a floating-point number. Implicit or explicit conversions are common.\par
{\pntext\f2\'B7\tab}\b String Data Type\b0 : String types can be converted to numeric types (if the string represents a valid numeric value) and vice versa. However, explicit conversion is usually required.\par

