\pard\sa200\sl276\slmult1 EDA \b0 stands for \ul\b\i Exploratory Data Analysis\ulnone\i0 . \b0 It is an approach to analyzing and summarizing key characteristics of a dataset with the help of statistical and graphical techniques.Here are few reasons why is it necessary:\par

\pard 
{\pntext\f0 1.\tab}{\*\pn\pnlvlbody\pnf0\pnindent0\pnstart1\pndec{\pntxta.}}
\fi-360\li720\sa200\sl276\slmult1\ul\b Understand the Data:  \ulnone\b0\par

